import {useState} from 'react'

import './App.css'

function App() {
    const [items, setItems] = useState([
        {
            title: 'Item 2',
            content: 'This is the content of item 2',
        },
        {
            title: 'Item 1',
            content: 'This is the content of item 1',
        },
    ])

    return <div className='App'></div>
}

export default App
